  let result = 0;
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("calculou");
    result = 4 / 2/*(Math.pow(props.text2, 2))*/;
    console.log(result);
  }

  return (
      <Main>
      <Card onSubmit={handleSubmit}>
        <TitleComponent/> 
